  "source": "pragma solidity >=0.4.24;\n\n//Importing openzeppelin-solidity ERC-721 implemented Standard\nimport \"../node_modules/openzeppelin-solidity/contracts/token/ERC721/ERC721.sol\";\n\n// StarNotary Contract declaration inheritance the ERC721 openzeppelin implementation\ncontract StarNotary is ERC721 {\n    // Star data\n    struct Star {\n        string name;\n    }\n\n    // Implement Task 1 Add a name and symbol properties\n    // name: Is a short name to your token\n    // symbol: Is a short string like 'USD' -> 'American Dollar'\n    string public name;\n    string public symbol;\n\n    constructor() public {\n        name = \"Star\";\n        symbol = \"STR\";\n    }\n\n    // mapping the Star with the Owner Address\n    mapping(uint256 => Star) public tokenIdToStarInfo;\n    // mapping the TokenId and price\n    mapping(uint256 => uint256) public starsForSale;\n\n    // Create Star using the Struct\n    function createStar(string memory _name, uint256 _tokenId) public {\n        // Passing the name and tokenId as a parameters\n        Star memory newStar = Star(_name); // Star is an struct so we are creating a new Star\n        tokenIdToStarInfo[_tokenId] = newStar; // Creating in memory the Star -> tokenId mapping\n        _mint(msg.sender, _tokenId); // _mint assign the the star with _tokenId to the sender address (ownership)\n    }\n\n    // Putting an Star for sale (Adding the star tokenid into the mapping starsForSale, first verify that the sender is the owner)\n    function putStarUpForSale(uint256 _tokenId, uint256 _price) public {\n        require(\n            ownerOf(_tokenId) == msg.sender,\n            \"You can't sale the Star you don't owned\"\n        );\n        starsForSale[_tokenId] = _price;\n    }\n\n    // Function that allows you to convert an address into a payable address\n    function _make_payable(address x) internal pure returns (address payable) {\n        return address(uint160(x));\n    }\n\n    function buyStar(uint256 _tokenId) public payable {\n        require(starsForSale[_tokenId] > 0, \"The Star should be up for sale\");\n        uint256 starCost = starsForSale[_tokenId];\n        address ownerAddress = ownerOf(_tokenId);\n        require(msg.value > starCost, \"You need to have enough Ether\");\n        _transferFrom(ownerAddress, msg.sender, _tokenId); // We can't use _addTokenTo or_removeTokenFrom functions, now we have to use _transferFrom\n        address payable ownerAddressPayable = _make_payable(ownerAddress); // We need to make this conversion to be able to use transfer() function to transfer ethers\n        ownerAddressPayable.transfer(starCost);\n        if (msg.value > starCost) {\n            msg.sender.transfer(msg.value - starCost);\n        }\n    }\n\n    // Implement Task 1 lookUptokenIdToStarInfo\n    function lookUptokenIdToStarInfo(uint256 _tokenId)\n        public\n        view\n        returns (string memory)\n    {\n        //1. You should return the Star saved in tokenIdToStarInfo mapping\n        // returns the name of the star\n        require(_exists(_tokenId), \"token id is invalid\");\n        return tokenIdToStarInfo[_tokenId].name;\n    }\n\n    // Implement Task 1 Exchange Stars function\n    function exchangeStars(uint256 _tokenId1, uint256 _tokenId2) public {\n        //1. Passing to star tokenId you will need to check if the owner of _tokenId1 or _tokenId2 is the sender\n        //2. You don't have to check for the price of the token (star)\n        //3. Get the owner of the two tokens (ownerOf(_tokenId1), ownerOf(_tokenId1)\n        address _owner1;\n        address _owner2;\n\n        if (ownerOf(_tokenId1) == msg.sender) {\n            _owner1 = ownerOf(_tokenId1);\n            _owner2 = ownerOf(_tokenId2);\n        } else {\n            _owner1 = ownerOf(_tokenId2);\n            _owner2 = ownerOf(_tokenId1);\n        }\n        //4. Use _transferFrom function to exchange the tokens.\n        transferFrom(_owner1, _owner2, _tokenId1);\n        transferFrom(_owner2, _owner1, _tokenId2);\n    }\n\n    // Implement Task 1 Transfer Stars\n    function transferStar(address _to1, uint256 _tokenId) public {\n        //1. Check if the sender is the ownerOf(_tokenId)\n        require(ownerOf(_tokenId) == msg.sender);\n        //2. Use the transferFrom(from, to, tokenId); function to transfer the Star\n        transferFrom(msg.sender, _to1, _tokenId);\n    }\n}\n",
