s or unsets the approval of a given operator An operator is allowed to transfer all tokens of the sender on their behalf.\",\"params\":{\"approved\":\"representing the status of the approval to be set\",\"to\":\"operator address to set the approval\"}},\"supportsInterface(bytes4)\":{\"details\":\"See `IERC165.supportsInterface`.     * Time complexity O(1), guaranteed to always use less than 30 000 gas.\"},\"transferFrom(address,address,uint256)\":{\"details\":\"Transfers the ownership of a given token ID to another address. Usage of this method is discouraged, use `safeTransferFrom` whenever possible. Requires the msg.sender to be the owner, approved, or operator.\",\"params\":{\"from\":\"current owner of the token\",\"to\":\"address to receive the ownership of the given token ID\",\"tokenId\":\"uint256 ID of the token to be transferred\"}}}},\"userdoc\":{\"methods\":{}}},\"settings\":{\"compilationTarget\":{\"/home/bitch1y/Downloads/Decentralized-Star-Notary-Service/contracts/StarNotary.sol\":\"StarNotary\"},\"evmVersion\":\"istanbul\",\"libraries\":{},\"optimizer\":{\"enabled\":false,\"runs\":200},\"remappings\":[]},\"sources\":{\"/home/bitch1y/Downloads/Decentralized-Star-Notary-Service/contracts/StarNotary.sol\":{\"keccak256\":\"0x8a8a7a54851e9deb803a23cb86fabd09c2229393137b6838ba06d8d93c5dbb59\",\"urls\":[\"bzz-raw://a4f5ce9f7d44f67e02384a16f8b2711778475d013ffff72a81ac55bc910c9367\",\"dweb:/ipfs/QmZ1gt3fgfvQaQxyeLLsrk4EqXRL5GaNnL7bZTnZu76NP5\"]},\"/home/bitch1y/Downloads/Decentralized-Star-Notary-Service/node_modules/openzeppelin-solidity/contracts/drafts/Counters.sol\":{\"keccak256\":\"0x5eb69360d3441ab2ee799bd7c007cccbffb0896f12b2dfe1456193e2aa180a11\",\"urls\":[\"bzz-raw://072e8b5a1b5acfc2acba9b6fb87d1dc57065aad44572617ad46b014074969eb3\",\"dweb:/ipfs/QmVTDHUriaxBJqiWCWgWC8vYaYYfXSz883LsowzTx1DcpK\"]},\"/home/bitch1y/Downloads/Decentralized-Star-Notary-Service/node_modules/openzeppelin-solidity/contracts/introspection/ERC165.sol\":{\"keccak256\":\"0xac2eacd7